//   Link } from "react-router-dom";
import { Routes, Route } from "react-router-dom";
import  Registration  from "./RegistrationPage"
import { List } from "./ListPage"

const Auth = observer(() => {
    return (
      <form>
        <div className="RegistrationPage">
          <div className="RegistrationHeader">
            <p>
              Авторизация 
            </p>         
          </div>
          <div className="MainWindowRegistration">
            <div>
              <p>
                Enter your Email:
              </p>
              <input className="Input"
                type="text"
                value={store.email}
                onChange={store.setEmail}
                placeholder="Enter email..."
                />
            </div>
            <div>
              <p>
                Enter your Password:
              </p>
              <input className="Input"
                type="text"
                value={store.password}
                onChange={store.setPassword}
                placeholder="Enter password..."
                />
            </div>
            <button type="button" onClick={() => store.sendAuthDate('Users/login', 'POST', '')}>Accept</button>


            <button variant="success" name="registration">re

            </button>

            {/* <Link to="/Registration">
              <button variant="success" name="registration">Registration</button>
            </Link>

            <Router>
              <Route path="/Registration" element={<Registration />}/>
            </Router> */}

          </div>
        </div>
      </form>
    )
})

export default Auth;
